const DisclosureTemplate: ComponentStory<typeof Button> = (args) => {
  const [active, setActive] = useState(false);

  const toggleDisclosure = () => setActive((prev) => !prev);

  return (
    <Button
      disclosure={active ? 'up' : 'down'}
      onClick={toggleDisclosure}
      {...args}
    />
  );
};

