const UploadTemplate: ComponentStory<typeof UnstyledButton> = ({
  children,
  upload,
  uploadOptions,
  ...args
}) => {
  const handleChange = (event: ChangeEvent<HTMLInputElement>) => {
    const files = Array.from(event.target.files || []);
    console.log({ files });
  };

  return (
    <UnstyledButton
      {...args}
      upload
      uploadOptions={{
        ...uploadOptions,
        allowMultiple: true,
        onChange: handleChange
      }}
    >
      {children}
    </UnstyledButton>
  );
};

